fields.description:
When running euca-delete-bundle --clear to delete a de-registered image, Eucalyptus fails to clean out the bucket completely, which causes euca-delete-bundle --clear to fail.

Steps to cause the issue:

* Bundle an image, using a ramdisk and kernel located in another bucket:
{code}
# euca-describe-images eki-C5D0395C eri-388832AA
IMAGE	eri-388832AA	updated-centos5-ramdisk/initrd-2.6.18-348.6.1.el5.img.manifest.xml	345590850920	available	public	x86_64	ramdisk				instance-store
IMAGE	eki-C5D0395C	updated-centos5-kernel/vmlinuz-2.6.18-348.6.1.el5.manifest.xml	345590850920	available	public	x86_64	kernel				instance-store
# euca-bundle-image -i images/euca-centos-2012.1.14-x86_64/euca-centos-2012.1.14-x86_64.img --kernel eki-C5D0395C --ramdisk eri-388832AA -r x86_64
{code}
* Upload image to Walrus:
{code}
# euca-upload-bundle -b centos5-cloudinit-test -m /var/tmp/bundle-9HzUe4/euca-centos-2012.1.14-x86_64.img.manifest.xml
{code}
* Register image:
{code}
# euca-register -n centos-cloudint centos5-cloudinit-test/euca-centos-2012.1.14-x86_64.img.manifest.xml
IMAGE	emi-1FF43761
{code}
* Deregister image (run twice):
{code}
# euca-deregister emi-1FF43761
{code}
* Attempt to delete bundle:
{code}
# euca-delete-bundle -b centos5-cloudinit-test -p euca-centos-2012.1.14-x86_64.img --clear
euca-delete-bundle: error (BucketNotEmpty): The bucket you tried to delete is not empty.
{code}

After seeing the error, I looked on under /var/lib/eucalyptus/bukkits and saw the following:

{code}
# ls /var/lib/eucalyptus/bukkits/centos5-cloudinit-test/
04c9f189-561e-4aa1-8735-8678d4e63117
# file /var/lib/eucalyptus/bukkits/centos5-cloudinit-test/04c9f189-561e-4aa1-8735-8678d4e63117
/var/lib/eucalyptus/bukkits/centos5-cloudinit-test/04c9f189-561e-4aa1-8735-8678d4e63117: Linux rev 1.0 ext3 filesystem data (large files)
{code}
